(144, 1, '2017-10-27 08:09:49', '2017-10-27 08:09:49', 'Thành phố Đà Lạt là tỉnh lỵ của tỉnh Lâm Đồng, nằm trên cao nguyên Lâm Viên, thuộc vùng Tây Nguyên, Việt Nam.', 'Đà Lạt', '', 'publish', 'closed', 'closed', '', 'da-lat', '', '', '2017-10-28 14:32:44', '2017-10-28 14:32:44', '', 0, 'http://localhost/realhome/?post_type=city&#038;p=144', 0, 'city', '', 0),
(146, 1, '2017-10-27 08:11:37', '2017-10-27 08:11:37', 'Cần Thơ là thành phố lớn, hiện đại và phát triển nhất ở Đồng bằng sông Cửu Long, đồng thời là một đô thị loại 1, thành phố trực thuộc Trung ương, nằm bên hữu ngạn của sông Hậu, thuộc vùng đồng bằng sông Cửu Long', 'Cần Thơ', '', 'publish', 'closed', 'closed', '', 'can-tho', '', '', '2017-10-28 14:32:58', '2017-10-28 14:32:58', '', 0, 'http://localhost/realhome/?post_type=city&#038;p=146', 0, 'city', '', 0),
